  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rntOptimize the performance of
  Gallium Antimonide (GaSb)-based 2.05 mm lasers (previously developed under JPL&amp;rsquo;s
  Research and Technology Development (R&amp;amp;TD) Program) for emission at the
  precise wavelength of 2.05 mm with an angular emission for efficient coupling into
  polarization maintained (PM) optical fiber&lt;br /&gt;rntDevelop a robust fiber
  coupled hermitically sealed package to house the diode laser while maintaining its
  high power and narrow linewidth performance&lt;br /&gt;rnt&amp;nbsp;Integrate these
  lasers in the frequency locked system (currently developed under under JPL R&amp;amp;TD
  Program) to demonstrate a frequency stable laser with at least 10 mW output power
  (with a 40-50mW goal), ~100 KHz linewidth, and 1 MHz long-term stability&lt;br /&gt;rnt&amp;nbsp;&lt;/p&gt;rn\",\n\t\"license_title\":
